window.bookSummaryJSON = "Captain Jack Aubrey and Stephen Maturin set sail aboard the Diane for the South China Sea, shepherding a diplomatic mission to prevent links between Bonaparte and the Malay princes. If their mission fails, English merchant shipping in the area will be threatened. At the barbaric court of Pulo Prabang, the stage is set for a duel of intelligence agents, pitting the savage cunning of Stephen Maturin against the French envoys, who are already entrenched in the Sultan's favor. <p>The thirteenth installment of Patrick O'Brian's hugely successful Aubrey/Maturin series.</p>"; 
